import * as types from './types'

export const initialState = {
    typeVariant: null,
    description: null
}

function suggestFormReducer(state = initialState, {type, payload = null}) {
    switch (type) {
        case types.SET_SUGGEST_FORM:
            return {...state,}
        case types.CLEAR_SUGGEST_FORM:
            return {...state,}
        case types.MAKE_SUGGEST_REQUEST:
            return {...state,}
        case types.MAKE_SUGGEST_COMPLETED:
            return {...state,}
        case types.MAKE_SUGGEST_FAILED:
            return {...state,}
        default:
            return state
    }
}

export default suggestFormReducer
